#include <stdlib.h>
#include <string.h>

int* sieveOfEratosthenes(int n, int* primesCount) {
    int* primes = (int*)malloc((n + 1) * sizeof(int));
    memset(primes, 1, (n + 1) * sizeof(int));
    primes[0] = primes[1] = 0;
    for (int i = 2; i * i <= n; i++) {
        if (primes[i]) {
            for (int j = i * i; j <= n; j += i)
                primes[j] = 0;
        }
    }
    *primesCount = 0;
    for (int i = 2; i <= n; i++) {
        if (primes[i]) primes[(*primesCount)++] = i;
    }
    return realloc(primes, (*primesCount) * sizeof(int)); // Adjust the array size to the number of primes
}

int** findPrimePairs(int n, int* returnSize, int** returnColumnSizes) {
    int primesCount;
    int* primes = sieveOfEratosthenes(n, &primesCount);
    *returnSize = 0;
    int** result = (int**)malloc(sizeof(int*) * primesCount);
    *returnColumnSizes = (int*)malloc(sizeof(int) * primesCount);

    for (int i = 0; i < primesCount; i++) {
        int x = primes[i];
        int y = n - x;
        if (x > y) break;
        if (x <= y && bsearch(&y, primes, primesCount, sizeof(int), (int(*)(const void*,const void*))strcmp)) {
            result[*returnSize] = (int*)malloc(sizeof(int) * 2);
            result[*returnSize][0] = x;
            result[*returnSize][1] = y;
            (*returnColumnSizes)[*returnSize] = 2;
            (*returnSize)++;
        }
    }

    free(primes);
    if (*returnSize == 0) {
        free(result);
        result = NULL;
        free(*returnColumnSizes);
        *returnColumnSizes = NULL;
    } else {
        result = (int**)realloc(result, (*returnSize) * sizeof(int*));
        *returnColumnSizes = (int*)realloc(*returnColumnSizes, (*returnSize) * sizeof(int));
    }

    return result;
}
